import React from "react";
import PayslipRow from "./PayslipRow";

const PayslipsTable = ({ payslips, onDelete, onDownload }) => {
  return (
    <table className="payslips-table">
      <thead>
        <tr>
          <th>Payslip ID</th>
          <th>User ID</th>
          <th>Month/Year</th>
          <th>Net Salary</th>
          <th>Download</th>
          <th>Delete</th>
        </tr>
      </thead>
      <tbody>
        {payslips.map((slip) => (
          <PayslipRow
            key={slip.PayslipID}
            slip={slip}
            onDelete={onDelete}
            onDownload={onDownload}
          />
        ))}
      </tbody>
    </table>
  );
};

export default PayslipsTable;
